import React,{ useState} from 'react';
import ReactDOM from 'react-dom';
import Navbar from "./navbar"
import Nxt from "./nxt"
import Adder from "./adder"

function App(){

   const [item,setItems] =useState([])

function test(event){
    console.log(event.target.value)

}

  return <div>
<Navbar />
<Nxt />
<Adder key={1} a={test}/>
<Adder key={2}  a={test}/>
<Adder key={3}  a={test}/>
<Adder key={4}  a={test}/>
  </div>
}
 

export default App
